 Anlık indirimlerden haberdar olmak için sayfayı takip edebilirsiniz <<
Bu tepsi için malzemeler ;
16 adet baklavalık yufka 
150 gr margarin yada tuzsuz tere yağı 
1 çay bardağından az eksik olacak kadar sıvı yağ 
1 su bardağı ceviz içi 
250 gr kadayıf 
Şerbeti için ;
3.5 su bardağı şeker 
3.5 su bardağı su 
Çeyrek limon 
Süslemek için ;
Yeşil fıstık 
Şerbeti 13-14 dk kaynatıp soğumaya bırakalım. Daha sonra 2 şerli yufkayı videoda görüldüğü gibi önce yağlayalım.Daha sonra bir başına bir avuç çiğ ve doğranmış kadayıfı yerleştirelim . Sonra da ceviz içi aynı şekilde ekleyelim. Rulo yapalım. Sıkmadan rulo yapıp borcamda dizelim. En son kalan yağı sarmış olduğumu tatlıların üzerine sürüp dilimlere ayıralım. 180 derece ısıtılmış fırına sürüp 10 dakika bu şekilde pişirelim. Sonra ayarını düşürüp 150 alalım bu şekilde de 15-20 dakika arayla kızarana kadar pişirelim. Fırından çıkınca tatlı sıcakken üzerine soğuğa yakın şerbeti gezdirip ilk yarım saat bekledikten sonra ılık veya tam soğuduktan sonra servis yapabilirsiniz . 
